import React from 'react'

const Navbar = () => {
    return (
        <nav className="nav-wrapper red darken-3">
            <div className = "container">
                <a className="brand-logo">Cute Pet</a>
                <ul className="right">
                    <li><a href="/">Home</a></li>
                    <li><a href="/adoption">Adoption</a></li>
                    <li><a href="/help">Help</a></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
